  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a combination of 3 separate
  FEMA collections (Blackstone, Charles-Quincy and Narragansett) with similar specifications.
  See the Ground Control process step for further information on functional areas.
  Ground Control is collected throughout the AOI for use in the processing of LiDAR
  data to ensure data accurately represents the ground surface. QA/QC checkpoints,
  (FVA and CVA - see Ground Control process step for further information) also collected
  throughout the AOI, are used for independent quality checks of the processed LiDAR
  data. LiDAR acquisition products include Pre- and Post- flight reports which contain
  information on the flightlines, equipment parameters, and other pertinent acquisition
  details. The LiDAR product itself consists of tiles of LAS points which are partially
  classified such that the bare earth points can be calibrated to the ground surface
  and tested via the independent QC to ensure the ground surface is accurately represented.\",\n\t\"owner_org\":
